text:
"При добавлении новой логики перезвона (либо если сотрудник откладывает связь с клиентом на определенную дату/время), нужно менять очередь таска с помощью колла UPDATE_PAYLOAD_FIELDS:
TASK_ID: TASK_ID_BO
FORCE_CHANGE_QUEUE: true
REQUEST: {
"NUMBER_OF_INCOMING_COMMUNICATIONS": 1 
}

При добавлении новой логики откладывания (если она равна НДЗ), нужно менять очередь таска с помощью колла UPDATE_PAYLOAD_FIELDS:
TASK_ID: TASK_ID_BO
FORCE_CHANGE_QUEUE: true
REQUEST: {
"NUMBER_OF_INCOMING_COMMUNICATIONS": 2 
}"
